//about 3 tesla 1.5 टेस्ला मशीन बद्दल 3 टेस्ला मशीन बद्दल सीटी स्कॅन बद्दल
​1) हे अत्यंत कार्यक्षम आहे आणि परीक्षेच्या वेळा कमी देतात.\n\n 2) हा लहान आकाराचा असल्याने रुग्णांना अधिक आनंददायी अनुभव प्रदान करतो बहुतेक एमआरआय स्कॅनरशी संबंधित कैद असलेल्या रुग्णांची भावना कमी करते.\n\n 3) 3 टेस्ला एमआरआयचे उच्च रिझोल्यूशन अधिक तपशीलवार प्रतिमा तयार करते, जे मेंदू, मणक्याचे आणि मस्क्युलोस्केलेटल सिस्टमच्या पॅथॉलॉजिकल परिस्थितीचे निदान करताना फायदेशीर ठरतात. रिजोल्यूशन आणि स्पष्टता देखील रेडिओलॉजिस्टला लहान जखम आणि शारीरिक रचना कमी ओळखण्यास परवानगी देते जे कमी शक्तिशाली मशीनसह पाहिले जाऊ शकत नाहीत.\n\n 4) हे अधिक अचूक निदानासह अधिक अत्याधुनिक इमेजिंग प्रक्रियेस अनुमती देते.\n\n 5) हे विकृत प्रतिमांचे जोखीम कमी करते, यामुळे पुन्हा स्कॅन करण्याची आवश्यकता दूर होते.\n\n
​1) येथे 1.5 टी आणि 3 टी मधील “टी” चा अर्थ टेस्ला आहे..\n\n 2) टेस्लाला एमआरआयमध्ये वापरल्या जाणार्‍या चुंबकाच्या सामर्थ्याचे वर्णन करण्यासाठी वापरल्या जाणार्‍या मोजमापाचे एकक म्हणून परिभाषित केले जाते.\n\n 3) एमआरआय (चुंबकीय अनुनाद इमेजिंग) हे चुंबक आहे.\n\n 4)हे लोहचुंबक एमआरआय मधील प्रतिमा कशा मिळवतात याचा आधार आहे.\n\n 5) त्या प्रतिमेच्या गुणवत्तेवर चुंबकाची शक्ती थेट परिणाम करते, तथापि, इतर अनेक घटकांद्वारे हे निश्चित केले जाते की कोणत्या व्यक्तीची प्रतिमा तयार केली जाते आणि कोणत्या शरीराच्या किंवा शरीराच्या विशिष्ट भागासाठी स्कॅन किंवा प्रतिमा काढल्या जातात यासाठी कोणती चुंबकीय शक्ती सर्वात योग्य आहे.\n\n
​1) ते आपल्या शरीरातील एका भागाभोवती फिरणारी एक अरुंद एक्स-रे किरण वापरतात. हे बर्‍याच वेगवेगळ्या कोनातून प्रतिमा मालिका प्रदान करते.\n\n 2) क्रॉस-सेक्शनल चित्र तयार करण्यासाठी संगणक या माहितीचा वापर करतो.\n\n 3) एका भाकरीच्या भागाच्या तुकड्यांप्रमाणेच, हे द्विमितीय (2 डी) स्कॅन आपल्या शरीराच्या आतील भागामध्ये “स्लाइस” दर्शवते.\n\n 4) बर्‍याच काप तयार करण्यासाठी या प्रक्रियेची पुनरावृत्ती केली जाते. आपल्या अवयवांची, हाडे किंवा रक्तवाहिन्यांची तपशीलवार प्रतिमा तयार करण्यासाठी संगणक हे स्कॅन स्टॅक करतो.\n\n 5) उदाहरणार्थ, शल्यक्रिया ऑपरेशनची तयारी करण्यासाठी ट्यूमरच्या सर्व बाजुकडे पाहण्यासाठी या प्रकारच्या स्कॅनचा वापर करू शकतो.\n\n
